inBirds = a.split(' ');

const migratoryBirds = (birds) => {
    birdObj = {};
    for (let bird of birds) {
        birdObj[bird] ? birdObj[bird] += 1 : birdObj[bird] = 1;
    }
    let max = 0;
    for (let key in birdObj) {
        if (birdObj[key] > max) {
            max = birdObj[key];
        }
    }
    let birdArr = [];
    for (let key in birdObj) {
        if (birdObj[key] === max) {
            birdArr.push(parseInt(key));
        }
    }
    let minBird = Infinity
    for (let bird of birdArr) {
        if (bird < minBird) {
            minBird = bird
        }
    }
    console.log(birdObj);
    console.log(max);
    console.log(birdArr);
    console.log(minBird);
    return minBird;
}
